('253534891611_10536572', 1263341660, 'הכל התחיל בשנת (בי) 1989 כשנולדתי...\nהשעה הייתה בערך 50 ולא הייתה לי מטריה.\nבחוץ ירד גשם ונרטב לי הביקיני הירוק שהשאלתי מאילון.\nאילון עוד לא נולד אז אבל הנחתי שהוא יסכים.\nוזהו', 0, '2010-01-31 00:45:44'),
