('253534891611_10537736', 1306237926, 'תריסי תאנים', 0, '2010-01-31 01:21:46'),
('253534891611_10578804', 1234657356, 'אוי כמה טוב הרוח הזאת על הבוקר\nהמהירות הזאת\nהרוח הזאת הרוח הזאת שהיא הרוח\nכמה טוב אבל.. טוב ובכן לאן אני נוסע?\nאני נוסע לעתיד\n כן כן לעתיד\nעליתי על האופניים בבוקר והיה להם ריח מוזר ואז הם התחילו ליסוע קדימה\nבזמן.\n\"אז רגע.. אתה מהעולם הזה עם הבגדים והכל? ואתה עם האופניים הגעת?\"\nהוא עצבן אותי כי הוא לא התכוון לענות לי מאיפה הוא יודע עברית\nאבל בוא נגיד שלא בכל יום רואים יצור עם 4 שדיים ועיניים במקום פטמות אז נשארתי איתו לדבר עוד קצת\nשעכשיו שאני חושב על זה.. לא היה בזה שום דבר מיני פשוט פליאה מוחלטת\nאפילו לא חשבתי לעצמי אם הוא זכר או נקבה\nשאלתי אותו לאן כדי לי ללכת כדי להכיר קצת את המקום\nוהוא אמר לי \"לך למלך שלנו\" התחלתי לחשוב על זה שאוליי לא נסעתי קדימה בזמן\nאוליי פשוט הצידה.. כי חוץ מעניין השדיים והמלך לא היה פה הרבה דומה לעולם שלי\nאז לפני שנפגשתי עם המלך חשבתי שזה קצת משונה שכל זר שמגיע הולך ונפגש עם המלך\nואוליי הם שולחים אותי בגלל שאני מבקר ממימד אחר\nמצד שני הם לא נראו כל כך מופתעים.\n\"ערב טוב לך גברתי\"\n\"אני לא גברת\"\n\"אני יודע מה איכפת לך אם זה טוב לי?\"\n\"תשמע זה קצת מטריד.. אני חושב שאני פשוט לא מספיק בטוח במיניות שלי כדי שיפנו אליי בלשון נקבה\"\n\"אתה נמשך למין שלך?\"\n\"לא פשוט אני מרגיש ילד ולא גבר ומהילד הדרך לאישה היא יותר קצרה מאשר הגבר\"\n\"הבנתי. טוב אתה התקבלת\"\n\"התקבלתי? למה?\"\n\"אתה לא רוצה להתקבל?\"\n\"אממ לא יודע תלוי למה\"\n\"פרטים לא חשובים פשוט תזרום אחי\"\nכמה טוב הרגשתי שהפכתי לאחי במקום גברת\nאהה כן זאת הייתה השיחה עם המלך.. בחור טוב.', 0, '2010-02-01 00:11:11'),
