('253534891611_13343508', 1306237926, 'זה לא תירוץ! תחפש את העננים שמעליך, בן, הם ישמרו עליך במסע החשוב הזה לארץ הביוב הקודח', 0, '2010-06-29 17:33:53'),
('253534891611_13343719', 1234657356, 'א א א ארץ הביוב הקודח\nשם ממרח שוקולד אני חולם שעלייך מורח\nמלקק כל פינה ולא רוצה להפסיק אבל\nהגיע התור של צביקה פיק\nמה הוא בכלל קשור לשיר הזה?\nהוא מקנא בי כי יש לך חזה כזה\nובעיניי זה טיפה טיפה מבזה\nאת ההיסטוריה המוסיקלית שלו\n(מוסיקלית שלו)\n', 0, '2010-06-29 18:20:26'),
