('253534891611_13344484', 1234657356, 'לא יכלת פשוט לפרגן לי? אוף אתה ממש עיסוי ', 0, '2010-06-29 21:02:50'),
('253534891611_13345273', 1324090839, 'לא יכלתי פשוט לפרגן לך?', 0, '2010-06-29 23:41:16'),
('253534891611_13345300', 1234657356, 'תראה אני השבוע הפסקתי לעשן.. ואני רוצה להגיד לך זהבי\nהמדינה שלנו היא מדינה שמשקרת לאזרחים שלה! משקרת!\nאני 4 ימים כבר לא מעשן והמדינה ישר קופצת עליי \"איפה היית שם?\" איפה הייתי?!? הייתי בבית! ומה הקטע עם כל המס הכנסה הזה? מה לא מספיק? עכשיו אני רוצה להגיד לך משהו שלדעתי באמת משחיט את המדינה הזאת\nהמונדיאל!\nגועל נפש של דבר ... והכל בגלל שאני צריך לעשן מול הטלוויזיה\nאז הם שולחים אליי שליחים של בנק הדואר!!\nגועל נפש!\nמה הם רוצים שנחליף ערוץ בכוח?\n', 0, '2010-06-29 23:45:31'),
('253534891611_13350743', 1324090839, 'תן לי לעבוד, להיות אותו מכשף שהיינו אותו. ארצה! בוא נבליג תרגילים של עוד וארכיבישוף משלים. וואו זה מריח לפעמים ואחרי המון אנשים זה סביבון. הפוך - לא יודעים שיבולת, אבל באמת, תרסיס צדק. ראש ממשלת בית שחי לשעבר אמר בראיון לערוץ האוטובוסים האדומים: \"מי שלא קופץ תשחץ\". והיא הייתה יותר, והיא הייתה יותר כי זה השיר האהוב. כולם שומרים את אהבתם למרגלות המצנפת? הרגשתי צמיג על חלון רגלי והוא היה צמרמורת עם שבע מאחוריה. למה אף אחד?? התשובה ברורה אבל זה כל הזקנים שלך. תרועת השפצורים ומעט תפזורת. לסיכום וכו\' וכו\' ושותפיו לפשע המזדנב של... הוא המנצחת שלנו היום אז בוא ניתן לו פיסוק בתנוך, אתם שומעים קרדינל? וזה מה שעשוי', 0, '2010-06-30 22:13:37'),
('253534891611_13350746', 1324090839, 'לייק :)', 0, '2010-06-30 22:13:57'),
