('253534891611_15746714', 1324090839, 'אני צריך להרוג את כל האנשים שעוד לא אנסו כי אין חלב בלי השמש. אז יצפאן היה חולם להיות מלח וכולם היו צוהלים אבל מה בעצם זה התחמושת? אני חושב שאין צורך בעוד דלי, אתה יודע לבחון? קדימה, לקפוץ על כל מי שיודע, אחת שתיים שלוש ולקנות הורים. טוב אין מילים, רק יפת, ואדוני אלוהינו אתה חייב לי כסף בתוך המכנסיים אז תראה לי איפה משתינים כאן את הקלפים כי אם אני יודע לבד זה יהיה אסון שכולו מדפסת. אתם יודעים מי הכי צמא? כן החלוצים שילכו לעזאזל הם וכל החרצנים שעל הכתפיים, צריך למשול בשביל להביך. רגע של שקיעה וארמונות של תופת עם מרפסת השלבים והיכולת לנצור מפרטים של דולף. שלום איפה הבית חולים הכי מצחיק? אמא שלי מנשקת עוברים בעוד היא עושה את זה. מה זה חינמון? אתה צריך להנפיק את זה בטנק שלכן, ככה יהיה לזה יותר אימפקט ופיצה. יכול להיות שאתה דרוזי או שסתם שלכת?', 2, '2011-04-18 02:31:27'),
