('253534891611_17529156', 1324090839, 'אני פעם שמעתי על מכנסי פנסים אבל לא היו מרפסות לנקות, אז מה שעשו הם לקחו את כל מי שנכנס אדר, שמו בתוך תנשמת וזעקו לאלוהים שיכבה את המוסיקה! רוצים לישון?? וואו! מעכשיו, לא צריך יותר להוריד מכת פחמן! 6!! הרי שמלחמות זה עניין של איזה מקרר אתה הכי חוצפן, בעיקר אם אתה מנקה ליצנים. מנקב ירחונים? מעקב פחונים! טוב תביאו לי את האהבה ואת משכנות המירוצים.. כי לפעמים כדאי להפוך לנינג\'ה (זה עוזר לתלמידים מתקשרים) כוח בננה! אינשאללה שיבוא הסתיו, אין שללה כי לא מזיעים בבית שחי - בית לחי - בית לחם שיפון - שיפור ניכר בטפטופי נרות השבוע! מי שמגניב הוא ריבון לאוטוסטרדה דה דה! מבצע מהיר! מי שקונה יותר כסף מקבל עציץ בראש! עציץ ורוד! עתיד בלוד! היי תגידי למה אתה עוטר שבחים? בגלל היונים שבך? אם תתרוצץ מספיק בסוף תנשום את איש האשכוליות, הוא גר בתולעי אוסישקין, זה ממש מטר מאסיה, איפה שכל הפיתומים והקלסרים השובבים. זה יוצא ארוך שכותבים הרבה מילים, לכן אקצר ואומר!', 5, '2011-07-29 16:39:27'),
