('253534891611_17564990', 1324090839, 'טוב זזתי להספיד את גבלס בבריכת המצופים, כל מי שעוד לא ניר שם! תפסו אותו! תפסו עליו! הוא מצחין מחתונת אבטיחים, אתם יודעים, כזאת שמארגנים במיוחד לאבטיחים.. יש שם רק אבטיחים. ואולי ממש המון אבטיחים. מבטיחים. אנחנו גם מטייחים עורלות, אם מישהו מכם פינצט (פינצט = זכר של אריק). יש לי זיכרון אחד והוא ינצח מהה?? הייתי מהמר עליך אמא! איזה סוסים אתה הכי אוהב לשמוע? בכל מקרה אם בא לך אני זורק אלבום חדש על וילונות - כאילו זה אלבום שמדבר על וילונות ועל כל הצרכים שלהם בעולם האכזר הזה (שתכלס מקדים את זמנו הא?) ואני גם זורק אותו על וילונות, ככה שכולם יוצאים עם כריות נוגט של הממשלה. האמנם קנית לי סכומים מלופפים?? שמעתי שצועקים!!!!!!', 1, '2011-08-01 00:35:19'),
