('253534891611_24561924', 1324090839, 'בעיר אחת, בלי רחובות,\nגר לו זקן, חכם בדורות.\nכה חכם היה הזקן,\nבשלב מסוים זה התחיל לעצבן.\nיום אחד צץ לו כלב גדול,\nכשכש ונבח, וביקש רק לשאול:\n\"זקן מכובד, אחד ויחיד,\nענה לי, בבקשה, אחת ולתמיד -\nאתה כה נבון, משכיל ומוכשר,\nמדוע שלא תהיה מאושר?\"\nהופתע הזקן למשמע אוזניו,\nמיד את הכלב תפס בזנב:\n\"אם עוד פעם אחת תדבר בלי רשות,\nאפנה למשרד עורכי דין ושות\'!\"\nשנים חלפו, ימים כלילות,\nבעיר פתאום נהיו רחובות.', 6, '2013-01-14 04:43:08'),
