('253534891611_24567072', 1482523674, 'בלב הים, ממש מזמן,\nחי לו תמנון, קטן קטן.\nיצא הוא ביום לחפש לאכול,\nבגלל שרצה היות תמנון גדול גדול.\nוכך, עם מגש וצלחת,\nכתף וקרחת,\nיצא הוא לטרוף,\nהוא רצה מרק עוף,\nביצה יבשה,\nאו אישה קשישה.\nבלי לכשכש,\nובלי לטרוק דלת,\nהגיע מיד על עיר הנזלת.\nבשער עמדה לה חיילת,\nבמקום רובה החזיקה טמפון,\nבמקום קסילופון היה לה שעון.\nואז,\nבבוקר מוזר, באמצע הכפר,\nנעמד התמנון ולעצמו הוא שר.\n\"יש לי כסף! ואין לי חובות!\"\nבעיר פתאום נהיו רחובות.\n\nמאת: זונה', 0, '2013-01-14 19:25:53'),
