('253534891611_25471999', 1263341660, 'הפיל והחצוצרה הלכו להם יחד.\nפתאום הם רואים אישה בעלת שני ילדים חמודים נורא.\nלאחד קוראים דובי ולאחד קוראים בן.\nהפיל ניגש רגע לדבר עם האישה. והוא שאל את החצוצרה חצוצרה את גם רוצה לבוא איתי?\nהחצוצרה אמרה : \"כן בטח למה לא\" ולא ובאה. יום אחד לדובי הייתה מחלה קשה והוא נפטר והיה עצוב נורא בלי דובי. \nדובי היה בסך הכל בן 10 ונחמד מאוד. ואנחנו כמובן שבאנו להלוויה של דובי.\nכולם בכו בהלוויה ומישהו אחד בא להלוויה זה היה הצייד והוא לא הרג את הפיל כי הוא היה נורא נחמד לדעתו אבל ככה זה באמת היה. והצייד גם היה נורא עצוב בגלל דובי וגם בגלל זה הוא לא הרג את הפיל הנחמד. \nיום אחרי ההלוויה בן הילד בן ה-15 הוא הלך לגן החיות כדי לראות את החיות ולא להיות כל-כך עצוב.\nוהחצוצרה גם כדי שלא יהיה לה עצוב היא ניגנה לה בשקט מוחלט נורא.\nואחרי כמה ימים הפתעה האישה הייתה בהריון ולבן שלה קראו משה ושם המשפחה שלו זה היה סיגל.\nואחרי שהוא שמע שאח שלו שהוא לא הכיר אותו נפטר אז הוא מאוד מאוד היה עצוב ונורא בכה.\nואחרי שנה הייתה לדובי אזכרה אבל הפיל והחצוצרה לא היו יכולים לבוא כי הם נסעו לחו\"ל ועזבו את האישה סתם ככה. והאישה הייתה נורא נורא מסכנה.\nהפיל והחצוצרה נסעו לבוסטון העיר האהובה עליהם ביותר.\nוהיה להם נורא כיף שם בבוסטון. הפיל והחצוצרה הלכו לבית שלהם והם הפיל והחצוצרה הלכו לישון.\nובלילה הם חלמו שניהם על אותו דבר הם חלמו על דובי נוסע עם אופניים סביב הבית שלו בכיף וצועק \"איזה כיף חיים גדול ביותר\".\nאבל זה היה רק חלום קטן.\nוהפיל והחצוצרה היו נורא עצובים שזה היה רק חלום.\nיום אחד היה צלצול טלפון בבית של הפיל והחצוצרה.\nותנחשו מי זה היה?\nאני אגיד לכם זה היה האישה והיא אמרה שהיא גרה בבית אחר לא בבית הקודם אבל הבית הזה היה בבוסטון.\nממש קרוב לבית של הפיל והחצוצרה.\nוכמעט כל יום החצוצרה והפיל היו באים לבקר את האישה והאישה הייתה מבקרת אותם והיה נורא כיף להם לגור בית ליד בית בשכנות טובה מאוד. והם שכחו את דובי.\nוככה כבר כל החיים כלום לא עצבן אותם.\nויום אחד היה גשם וסערה הייתה בחוץ ואף אחד לא רצה ללכת החוצה לקניות או משהו כזה וכל אחד נשאר בבית שלו אבל הם היו יכולים לבקר אחד את השני כי הם היו שכנים והם חיברו את שני הבתים שלהם לבית אחד גדול נורא והם בקרו אחד את השני ויום אחרי זה היה להם שלג בחוץ והם יצאו לשחק בשלג ולגלוש וכל אלה.  הסוף.', 5, '2013-04-15 04:14:53'),
