('253534891611_25829083', 1324090839, 'כשאנשים משחקים את המשחק הזה שהם רצים במעגל ומנסים לתפוס את הזנב של עצמם אני מיד חושב שהם חתולים ושהם צריכים לשתף אחרים במשחקים שלהם. מעבר לזה אני חושב שזו הצלחה מסחררת!', 1, '2013-05-14 18:22:36'),
('253534891611_25829174', 1324090839, 'אוקיי אז הנה הסוד הגדול - איך להשיג כל בחורה?! אתה זורק אותה לנהר ומספר לחברות שלה שזה היה בהסכמה, אחר כך אתה כאילו מציל אותה אבל לא באמת, דוחף לה את הראש חזרה לתוך המים עד שהיא מראה סימני עניין, ואז כשאתה הכי פחות מצפה לזה, תוציא לה את הראש מהנהר ותקריא לה צוואה של מישהו, ואז איך שהיא מתאהבת בך תגיד שלום ותוסיף אותה בסקייפ אבל אל תגלה לה שאין לך מצלמת אינטרנט, ואז ככה איך שחברות שלה כבר ממש שכחו ממנה אתה שופך עליה רוטב, חמש דקות בתנור וזה מוכן! נו טעים לך יא מאוהב??', 2, '2013-05-14 18:31:06'),
('253534891611_25829209', 1263341660, 'אז יואב סיפור יפה אבל בוא תשמע למה לא כדאי להיזרק דווקא באשקלון:', 0, '2013-05-14 18:33:16'),
('253534891611_25829235', 1263341660, '\"איך להשיג כל בחורה\" (מאת: יריב) - ראית אותה יושבת לבד בארובה? היא עשתה לך סימנים של ארדואן? לא יודע איך להקליט בממיר? המדריך הזה בשבילך: הדבר הראשון שעליך לעשות הוא לפתוח אקסל, תגיד לי כשסיימת.', 0, '2013-05-14 18:35:25'),
('253534891611_25829291', 1263341660, 'תרופת הרגעה או סם הרגעה הוא חומר שגורם לרוגע על ידי תחרות אתלטיקה. שיא העולם הנוכחי לגברים הוא אולם כדורסל השוכן בבלגרד בירת סרביה. שוחד הוא טובת הנאה, בכסף או  בעקבות לחיצה על קישור, נודה לכם אם תחזרו לדף שממנו באתם, ותתקנו את הקישור כך שיַפנה ישירות אל הערך המתאים.', 1, '2013-05-14 18:39:11'),
('253534891611_25829361', 1324090839, 'טוב עכשיו באמת, הנה ה-שיטה - איך להשיג כל בחורה!! אתה זורק אותה לנהר ומחכה שהיא תצוף, אחר כך אתה משתין בנחת אבל לא לנהר יא מטנף! ואז אתה עושה חיקויים של הבכי של ההורים שלה ועושה מזה ים כסף בתפוצות, יום אחד שאתה כבר מפורסם וכולך טחון, מגלים שהיא חיה ועובדת כמלצרית בתפוצות וואלה ממלצרת את כולם מנסה להרוויח ג׳ובות וללכת ללמוד ״מנהל השקים״!!!', 0, '2013-05-14 18:43:34'),
('253534891611_25829388', 1263341660, 'יש עוד שיטה להשיג כל בכורה: אתה מתחפש ליד קטן שלא יודע כלום מהחיים שלו, מוותר לסבא גם, וקונה שעון מעורר. אחרי בערך שבועיים כשתבין שאין לך סיכוי להשתזף, תלך לים, תמתין כמה דקות וזה מוכן.', 0, '2013-05-14 18:46:00'),
('253534891611_25829399', 1263341660, 'בלי קפיצות אין נשמה!! הצביעו ג\'', 0, '2013-05-14 18:46:45'),
('253534891611_25829410', 634136231, 'דאודורנט גבר', 0, '2013-05-14 18:47:30'),
