('253534891611_25830347', 713648503, '\"ברוך השם, אני פורל!\"', 0, '2013-05-14 20:12:43'),
('253534891611_25838235', 743578418, 'בלורית שלום! שמי נוטרייה בת 26 מרמת המורד. אני כותבת לך בעקבות הפוסט \"איך להשיג כל בחורה?\" שהופיע בירחון \"נבטים\" בחודש שעבר עלינו לטובה בעזרת השם. בשבוע שעבר הלכתי להשלים את הבגרות שלי בספרות ואת הבגרות שלך בספורט (הציון שלך לא היה עגול). בריצת האלפים הגעתי מקום שני רק לשני מיב\' 5 (עם הגומיות בישבן). עשיתי כל מה שאמרת ולא הצלחתי להשיג אותה. רציתי לדעת האם שמך הוא על שמי? תודה רבה, מיתר נביעות, בת 27 מנביאי סבתא.', 5, '2013-05-15 10:15:31'),
('253534891611_25846743', 1263341660, 'יהודי טוב זה ערבי מת', 1, '2013-05-16 00:52:20');
