('253534891611_26008820', 1708214783, 'השיחה הבאה מבוססת על שיחה אמיתית:\n-\"הלו?\"\n-\"שלום רבקה. מה שלומך?\"\n-(שתיקה)\n-\"רבקההה!\"\n-\"הההאאאללללווווו !??\"\n-\"ררררבקהההההה !!\"\n-\"כן?\"\n-\"זו מממממרריייים\"\n-\"היי מרים מה שלומך?\"\n-\"רב תודות. התקשרתי לשאול האם שמעת על המבצע החדש של חוש השמיעה\"\n-\"למה שאני אשמוט את הכביסה של חושחש הבלש??\"\n-\"המבצע החדש של חוש השמיעה!!!\"\n-\"אהה, לא שמעתי. מה המבצע?\"\n-\"קני אוזניים חדשות ותקבלי מקפל שרוולים במתנה\"\n-\"נהדר. כמה עולות אוזניים חדשות?\"\n-\"בשבילך זה 666 זלוטים\"\n-\" איזו עסקה משתלמת! רציתי לקנות אוזניים חדשות בהום סנטר ודודו אמר לי שזה עולה\n1,000 זלוטים!!\"\n רוצים גם אתם לקנות אוזניים חדשות במחיר משתלם ולקבל מקפל שרוולים???\nחייגו עכשיו- כוכבית מה?!?%@#? לא שמעתי!! - וקבלו את חוש השמיעה שלכם חזרה!', 1, '2013-05-29 16:42:27'),
