('253534891611_26311629', 713648503, 'נקרע לי הקלמר, נפלו כל העטים, פגעו בחתול שילל וילל וילל עד שהגיע שוטר, קנס אותי בזול, אמרתי לו \"די בבקשה\" והוא שלח אותי לכלא על חיצוף, שם פגשתי את אישתי לעתיד, שתחיה, איתה קניתי בית גדול גדול עם חלונות גדולים גדולים, קערות ענקיות ענקיות ודלת בגודל נורמלי למה מה יעזור לי דלת גדולה, ושם היה חתול, שפתאום קנה לי עטים חדשים בתוך קלמר חדש ולא קרוע בכלל!\n\nמוסר ההשכל: אל תמסור השכל אלא אם כן אתה בטוח שמי שאתה מוסר לו מוכן לזה.', 2, '2013-06-23 00:04:04'),
