('253534891611_26315118', 1047541598, 'כולנו בסירה גדולה. פתאום הקירות מתחילים להתפורר ואנחנו בקריסס. אז האמריקאי זורק כסף ואומר יש הרבה מזה איפה שאני בא ואני מנסה להזכר כל הזמן איפה החניתי את המדיח המטייל שלי. פתאום מי מגיח? מי חמוד של אבא? גנבתי לכולכם את האף וברחתי לסיני. אל תגיבו. השתיקה אומרת יותר ממה שאי פעם תוכלו להגיד במילים או בריקוד החיים.', 1, '2013-06-23 09:20:10'),
