('253534891611_27193353', 743578418, 'וואלה, אחי, היום החיים זה לא כמו פעם. פעם אף אחד לא היה מדבר אצלנו ככה. אומר וואלה, אני אנצל את המדינה עד הסוף. וואלה, אחי, זה למה המדינה שלנו נראית ככה. כולם רק רודפים אחרי הסלבים, מי נפרד ממי, וואלה, אני אומר לך אחי, זה שאנחנו מקבלים ככה את ההומואים זה גם חלק מהבעיה. הכל בראש, אני אומר לך. תראה את הספורט בארץ שלנו - ביזיון. תראה את הפוליטיקאים - מאז שרון לא היה לנו מנהיג אמיתי. וגם הריאליטי - מאז קחי אותי שרון אף אחד לא לקח פה אף אחד ברצינות. וואלה, אחי, תראה את הרס\"ר שלנו. מתנהג כאילו המדינה הזאת שלו. מי חושב שבנה אותה? הסבים שלו או שלי? אשכנזי מניאק.', 2, '2013-09-06 21:54:30'),
