('253534891611_27417629', 100004124261604, 'לפני שבקשתי חלמתי וזה נסגר עליו כאילו התאפשר לא במודע, סמל למחשבות או שלפחות נמאס עלי לי בהגיון מתמדת. תהיה קצר ולעניין כלוא בסורק למכשפות, ניצוד ומשתף כל רגע. סיבה ואז תאוצה, נימרוד מתבודד כי נימרוד מתבודד 1 2 3. מלפני. ומלפני שבקשת הוא ניגב וכבר שילב את השלכת בסמיכה עלינו, ונרדם. \nחפש מסרים סמויים בשירים: משהו בא לפיטרס עכשיו ?', 3, '2013-09-25 22:39:16'),
