('253534891611_27461948', 743578418, 'היי דוגמיתי, רציתי לדעת את המון עליזה. קורצ\'אק התקשר אליי, הבן זונה, כולם תכירו זאת אילנה ידעתי ברור שפטרנו, שלא משנה.. זה מה שרציתי להגיד. כיוון שאת מתה, תנאים לין עבודות כביש. נו, די להגיב. בקיצור - כיוון שאת מתה ביום הולדת שלך, ולא אוכל לאחל (סקנדינביה) לך דברים לשנה הבאה הנה כבר דברים לשנה שעברה (בית המשפט האילון) - שלא ידעת עוד צער, שהעוגה הייתה טעימה, שקיבלת את כל המתנות שרציתי, שהייתה לך רפואה שלמה, שביום כיפור היה לך צום קל (BACKSPACE), שהייתם לברוגז ולא לשועל, שחלמת חלום על בטוח אילון, שרצית את כל מה שקיבלת, שנכוות מתנור סלילים פעמיים מעל הממוצע השנתי של יוצאי מלזיה, שמזרח היה לך תמיד לעזר, שקיבלת דוגמיתי, רציתי לדעת את המון עליזה. קורצ\'ק התקשר אלי, בן הזונה, כולם תכירו זו אילנה ידעתי ברוך שפטרנו שלא משנה. מה שרציתי להגיד, כיוון שאינך בת החיים, תנעים לי את הזמן, קדימה הפסיקו להגיד. בקיצור - מכיוון שאת קשה מנשוא נשוא. אין לי מושא.', 0, '2013-09-29 18:13:01'),
