('253534891611_27994217', 1497027173, 'והיום אני, אוכיח שאתם יכולים להוכיח שאתה יודע ששתיים ועוד שתיים שווה לאפס! אתה נכנסים לסניף של דיסקונט, או אפילו יס או הוט, או מקום כזה להשכרת רכיבים, לא משנה, נגיד בית חולים, או בנק הפועלים. כנסו תיכנסו לבפנים, לתוך המקום שבחרתם, המקום שולי. שילשול. לך לאחד הפקידים היותר נחמדים, ושאל איפה השירותים. אחרי שהוא יענה תגיד, תודה, לא משנה, אני אתאפק עד הבית ותלך בכל זאת, בשביל לא להעליב את הזרזיף. אל תשתין באמת, או קקי, תתאפק עד הבית כמו שהבטחת ואם לאו אז כמו שאמרת. לחזור אליו, הוא בטח יחייך ויהיה יחף. אוי, תמים שכמותו... אז תבוא אליו, ואז ככה, הוא הרי הפקיד הנחמד ואתה הלקוח שלו, נחמד או לאו. את זה אתה תחליט, כדאי להשתמש ביוד. עזוב את העט אמרתי עזוב!! תסתכל לו בעיניים ותגיד לו \"שתיים ועוד שתיים שווה לאפס\" הוא ישאל \"מה?..\" -\"שתיים ועוד שתיים שווה לאפס!!!!\" הוא יבהה בך במבט מוזר ויגיד \"לא נכון\". -\"כן נכון\", אתה עונה, ויודע שבידך הניצחון שהרי הלקוח תמיד צודק.\nמ.ש.ל.', 3, '2013-11-11 20:51:37'),
